// src/components/Gallery.js
import React from 'react';
import './Gallery.css';

const Gallery = () => {
  const images = [
    { src: '/food1.jpg', title: 'Soul Soup', description: 'Great for the soul' },
    { src: '/food2.jpg', title: 'Scenario Day', description: 'Perfect for any scenario' },
    { src: '/food3.jpg', title: 'Delicious Day', description: 'Delicious and nutritious' },
    { src: '/food4.jpg', title: 'Yummy Soup', description: 'Yummy and healthy' },
    { src: '/food5.jpg', title: 'Veggie Delight', description: 'Full of vegetables' },
    { src: '/food6.jpg', title: 'Healthy Meal', description: 'Healthy and balanced' },
    { src: '/food7.jpg', title: 'Tasty Dish', description: 'Tasty and filling' }
  ];

  return (
    <div className="gallery">
      {images.map((image, index) => (
        <div className="gallery-item" key={index}>
          <img src={image.src} alt={image.title} className="gallery-image" />
          <h3>{image.title}</h3>
          <p>{image.description}</p>
        </div>
      ))}
    </div>
  );
};

export default Gallery;
